s=\"message\">\nStub<br/>\n</div>','wakabamark',4),(13,'tos','ru','–£—Å–ª–æ–≤–∏—è –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª–µ–Ω–∏—è —Å–µ—Ä–≤–∏—Å–∞','Stub\n','<div class=\"message\">\nStub<br/>\n</div>','wakabamark',6),(14,'wakabamark','en','Text markup','Hanabira uses altered version of wakabamark (http://wakaba.c3.cx/docs/docs.html#WakabaMark), with following syntax:\nInline markup:\n`*Italic text*` -> *Italic text*\n`_Italic text_` -> _Italic text_\n`**Bold text**` -> **Bold text**\n`__Bold text__` -> __Bold text__\n`_**Italic bold text**_` -> _**Italic bold text**_\n`__*Italic bold text*__` -> __*Italic bold text*__\n```–ú–æ–Ω–æ—à–∏—Ä–∏–Ω–Ω—ã–π` ‚Üí –ú–æ–Ω–æ—à–∏—Ä–∏–Ω–Ω—ã–π``\n        __–Ω–µ—Ñ–æ—Ä–º–∞—Ç–∏—Ä—É–µ–º—ã–π__ *–º–æ–Ω–æ—à–∏—Ä–∏–Ω–Ω—ã–π* ‚Üí __–Ω–µ—Ñ–æ—Ä–º–∞—Ç–∏—Ä—É–µ–º—ã–π__ *–º–æ–Ω–æ—à–∏—Ä–∏–Ω–Ω—ã–π* (4+ –ø—Ä–æ–±–µ–ª–∞ –æ—Ç –∫—Ä–∞—è —Å—Ç—Ä–æ–∫–∏)\n     –°—Ç—Ä–æ–∫–∞ —Å –æ—Ç—Å—Ç—É–ø–æ–º (1-3 –ø—Ä–æ–±–µ–ª–∞)\n`–ó–∞—á—ë—Ä–∫–Ω—É—Ç—ã–π —Ç–µ–∫—Å—Ç^W^W` ‚Üí –ó–∞—á—ë—Ä–∫–Ω—É—Ç—ã–π —Ç–µ–∫—Å—Ç^W^W\n`–ó–∞—á—ë—Ä–∫–Ω—É—Ç—ã–π —Ç–µ–∫—Å—Ç^H^H^H^H` ‚Üí –ó–∞—á—ë—Ä–∫–Ω—É—Ç—ã–π —Ç–µ–∫—Å—Ç^H^H^H^H\n`Link to post >>postid` -> >>123\n`Link to post on other board >>/board/postid` -> >>/board/123\n`Link to site http://www.example.com/` -> http://www.example.com/\n`%%Inline spoiler%%` -> %%Inline spoiler%%\n\nMultiline markup:\n``\n%%\nSpoiler block\nLine 2\n%%\n``\n ‚Üì\n%%\nSpoiler block\nLine 2\n%%\nMultiline code\n    ``\n    **Line 1**\n    __Line 2__\n    ``\n ‚Üì\n``\n**Line 1**\n__Line 2__\n``\nList\n``\n* abc\n* efg\n** jik\n** lnm\n* xyz\n``\n ‚Üì\n* abc\n* efg\n** jik\n** lnm\n* xyz\n','<div class=\"message\">\nHanabira uses altered version of wakabamark (<a href=\"http://wakaba.c3.cx/docs/docs.html#WakabaMark\" rel=\"nofollow\">http://wakaba.c3.cx/docs/docs.html#WakabaMark</a>), with following syntax:<br/>\nInline markup:<br/>\n<code>*Italic text*</code> -&gt; <em>Italic text</em><br/>\n<code>_Italic text_</code> -&gt; <em>Italic text</em><br/>\n<code>**Bold text**</code> -&gt; <strong>Bold text</strong><br/>\n<code>__Bold text__</code> -&gt; <strong>Bold text</strong><br/>\n<code>_**Italic bold text**_</code> -&gt; <em><strong>Italic bold text</strong></em><br/>\n<code>__*Italic bold text*__</code> -&gt; <strong><em>Italic bold text</em></strong><br/>\n<code>`–ú–æ–Ω–æ—à–∏—Ä–∏–Ω–Ω—ã–π` ‚Üí –ú–æ–Ω–æ—à–∏—Ä–∏–Ω–Ω—ã–π</code><code><pre>\n    __–Ω–µ—Ñ–æ—Ä–º–∞—Ç–∏—Ä—É–µ–º—ã–π__ *–º–æ–Ω–æ—à–∏—Ä–∏–Ω–Ω—ã–π* ‚Üí __–Ω–µ—Ñ–æ—Ä–º–∞—Ç–∏—Ä—É–µ–º—ã–π__ *–º–æ–Ω–æ—à–∏—Ä–∏–Ω–Ω—ã–π* (4+ –ø—Ä–æ–±–µ–ª–∞ –æ—Ç –∫—Ä–∞—è —Å—Ç—Ä–æ–∫–∏)\n –°—Ç—Ä–æ–∫–∞ —Å –æ—Ç—Å—Ç—É–ø–æ–º (1-3 –ø—Ä–æ–±–µ–ª–∞)</pre></code>\n<code>–ó–∞—á—ë—Ä–∫–Ω—É—Ç—ã–π —Ç–µ–∫—Å—Ç^W^W</code> ‚Üí <del>–ó–∞—á—ë—Ä–∫–Ω—É—Ç—ã–π —Ç–µ–∫—Å—Ç</del><br/>\n<code>–ó–∞—á—ë—Ä–∫–Ω—É—Ç—ã–π —Ç–µ–∫—Å—Ç^H^H^H^H</code> ‚Üí –ó–∞—á—ë—Ä–∫–Ω—É—Ç—ã–π —Ç<del>–µ–∫—Å—Ç</del><br/>\n<code>Link to post &gt;&gt;postid</code> -&gt; <a>&gt;&gt;123</a><br/>\n<code>Link to post on other board &gt;&gt;/board/postid</code> -&gt; <a>&gt;&gt;/board/123</a><br/>\n<code>Link to site http://www.example.com/</code> -&gt; <a href=\"http://www.example.com/\" rel=\"nofollow\">http://www.example.com/</a><br/>\n<code>%%Inline spoiler%%</code> -&gt; <span class=\"spoiler\">Inline spoiler</span><br/>\n<br/>\nMultiline markup:<code><pre>\n%%\nSpoiler block\nLine 2\n%%</pre></code>\n¬†¬† ‚Üì<div class=\"spoiler\">\n\nSpoiler block<br/>\nLine 2\n</div>\nMultiline code<code><pre>\n``\n**Line 1**\n__Line 2__\n``</pre></code>\n¬†¬† ‚Üì<code><pre>\n**Line 1**\n__Line 2__</pre></code>\nList<code><pre>\n* abc\n* efg\n** jik\n** lnm\n* xyz</pre></code>\n¬†¬† ‚Üì<ul><li>\n abc</li><li>\n efg</li><ul><li> jik\n</li><li>\n lnm\n</li></ul><li>\n xyz</li></ul>\n</div>','wakabamark',3),(15,'opinions','ru','–°–≤–æ–±–æ–¥–∞ –º–Ω–µ–Ω–∏–π –∏ –≤–∑–∞–∏–º–æ—É–≤–∞–∂–µ–Ω–∏–µ','–î–æ–±—Ä–æ—á–∞–Ω —è–≤–ª—è–µ—Ç—Å—è –º–µ—Å—Ç–æ–º, –≤ –∫–æ—Ç–æ—Ä–æ–º –º–æ–∂–Ω–æ –æ–±—Å—É–∂–¥–∞—Ç—å –ª—é–±—ã–µ —Ç–µ–º—ã –∏ –≤—ã—Å–∫–∞–∑—ã–≤–∞—Ç—å –ø–æ –Ω–∏–º –ª—é–±—ã–µ, —Å–∫–æ–ª—å —É–≥–æ–¥–Ω–æ —Ä–∞–¥–∏–∫–∞–ª—å–Ω—ã–µ –º–Ω–µ–Ω–∏—è, –ø–æ–∫–∞ –æ–Ω–∏ –æ—Å—Ç–∞—é—Ç—Å—è –≤ —Ä–∞–º–∫–∞—Ö –∑–∞–¥–∞–Ω–Ω–æ–π —Ç–µ–º—ã.\r\n\r\n–î–ª—è —Ä–µ–∞–ª–∏–∑–∞—Ü–∏–∏ —ç—Ç–æ–π –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç–∏ –≤ –ø–æ–ª–Ω–æ–π –º–µ—Ä–µ, –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –æ–±–µ—Å–ø–µ—á–∏—Ç—å —Å–æ–±–ª—é–¥–µ–Ω–∏–µ –¥–≤—É—Ö –∫–ª—é—á–µ–≤—ã—Ö –ø—Ä–∏–Ω—Ü–∏–ø–æ–≤ ‚Äî –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–∏–≤–Ω–æ–π –∞—Ç–º–æ—Å—Ñ–µ—Ä—ã –∏ –æ—Ç—Å—É—Å—Ç–≤–∏—è –¥–∏—Å–∫—Ä–∏–º–∏–Ω–∞—Ü–∏–∏ –ø—Ä–æ—Ç–∏–≤ –∞–≤—Ç–æ—Ä–æ–≤, –≤—ã—Å–∫–∞–∑—ã–≤–∞—é—â–∏—Ö –Ω–µ–ø–æ–ø—É–ª—è—Ä–Ω—ã–µ, —Ä–∞–¥–∏–∫–∞–ª—å–Ω—ã–µ –∏–ª–∏ –ø—Ä–æ—Ç–∏–≤–æ—Ä–µ—á–∞—â–∏–µ –Ω–æ—Ä–º–∞–º —Å–æ—Ü–∏—É–º–∞/–±–æ—Ä–¥–æ–≤–æ–π —Å—É–±–∫—É–ª—å—Ç—É—Ä—ã –º–Ω–µ–Ω–∏—è.\r\n\r\n–ù–∞ –ø—Ä–∞–∫—Ç–∏–∫–µ —ç—Ç–æ –≤—ã—Ä–∞–∂–∞–µ—Ç—Å—è –≤ –∑–∞–ø—Ä–µ—Ç–µ –æ–±—Å—É–∂–¥–µ–Ω–∏—è –ª–∏—á–Ω–æ—Å—Ç–∏ –∞–≤—Ç–æ—Ä–æ–≤ —Å–æ–æ–±—â–µ–Ω–∏–π, –µ—Å–ª–∏ –ª–∏—á–Ω–æ—Å—Ç—å –∞–≤—Ç–æ—Ä–∞ –Ω–µ —è–≤–ª—è–µ—Ç—Å—è –∏—Å—Ö–æ–¥–Ω–æ –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º–æ–π, –ø–æ–ø—ã—Ç–æ–∫ –≤—ã–Ω—É–¥–∏—Ç—å –∏—Ö –ø—Ä–µ–∫—Ä–∞—Ç–∏—Ç—å –ø—É–±–ª–∏—á–Ω–æ –≤—ã—Ä–∞–∂–∞—Ç—å —Å–≤–æ–µ –º–Ω–µ–Ω–∏–µ –∏ –ø–æ–ø—ã—Ç–æ–∫ –ø–æ–¥–º–µ–Ω–∏—Ç—å —Ç–µ–º—É –æ–±—Å—É–∂–¥–µ–Ω–∏—è.\r\n\r\n–ö–∞–∫ –ø—Ä–∞–≤–∏–ª–æ, –±–æ–ª—å—à–∏–Ω—Å—Ç–≤–æ —Ä–∞–∑–ª–∏—á–∏–π –º–µ–∂–¥—É –≤—ã—Ä–∞–∂–µ–Ω–∏–µ–º –º–Ω–µ–Ω–∏—è –∏ –æ–±—Å—É–∂–¥–µ–Ω–∏–µ–º/–¥–∞–≤–ª–µ–Ω–∏–µ–º –Ω–∞ –∞–≤—Ç–æ—Ä–∞ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É–µ—Ç –æ–¥–Ω–æ–º—É –∏–∑ —Å–ª–µ–¥—É—é—â–∏—Ö —Ç—Ä–µ—Ö —Å—Ü–µ–Ω–∞—Ä–∏–µ–≤:\r\n\r\n[1] ‚Äî –î–∞–≤–∞–π—Ç–µ –æ–±—Å—É–∂–¥–∞—Ç—å –•.\r\n[2] ‚Äî –ú–Ω–µ –∫–∞–∂–µ—Ç—Å—è, —á—Ç–æ –• –±—è–∫–∞.\r\n[3] ‚Äî >>2 –ú–Ω–µ –∫–∞–∂–µ—Ç—Å—è, —á—Ç–æ –±—è–∫–∞ —ç—Ç–æ —Ç—ã.\r\n\r\n–í –¥–∞–Ω–Ω–æ–º —Å–ª—É—á–∞–µ [2] –≤—ã—Å–∫–∞–∑—ã–≤–∞–µ—Ç –º–Ω–µ–Ω–∏–µ, —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–µ –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º–µ, –∞ [3] –ø–µ—Ä–µ—Ö–æ–¥–∏—Ç –∫ –æ–±—Å—É–∂–¥–µ–Ω–∏—é –ª–∏—á–Ω–æ—Å—Ç–∏ –∞–≤—Ç–æ—Ä–∞ —Å–æ–æ–±—â–µ–Ω–∏—è, —Ç–µ–º —Å–∞–º—ã–º –Ω–∞—Ä—É—à–∞—è –ø—Ä–∞–≤–∏–ª–∞ –∏ –º–µ—à–∞—è –æ–±—Å—É–∂–¥–∞—Ç—å –•.\r\n\r\n–ü—Ä–∏ —ç—Ç–æ–º, –Ω–µ—Å–º–æ—Ç—Ä—è –Ω–∞ —Ç–æ, —á—Ç–æ [2] –º–æ–∂–µ—Ç –æ—Å–∫–æ—Ä–±–ª—è—Ç—å —á—É–≤—Å—Ç–≤–∞ –Ω–µ–∫–æ—Ç–æ—Ä—ã—Ö –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª–µ–π, —è–≤–ª—è—é—â–∏—Ö—Å—è –ø—Ä–∏–≤–µ—Ä–∂–µ–Ω—Ü–∞–º–∏ –• –∏–ª–∏ –∏–Ω—ã–º –æ–±—Ä–∞–∑–æ–º —Å–µ–±—è —Å –• –∞—Å—Å–æ—Ü–∏–∏—Ä—É—é—â–∏—Ö, —ç—Ç–æ –Ω–µ —è–≤–ª—è–µ—Ç—Å—è –Ω–∞—Ä—É—à–µ–Ω–∏–µ–º –ø—Ä–∞–≤–∏–ª –ø–æ–∫–∞ –º–Ω–µ–Ω–∏–µ –æ—Å—Ç–∞–µ—Ç—Å—è –≤ —Ä–∞–º–∫–∞—Ö –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º—ã –∏ –Ω–µ –Ω–∞–ø–∏—Å–∞–Ω–æ –∏—Å–∫–ª—é—á–∏—Ç–µ–ª—å–Ω–æ —Ä–∞–¥–∏ –≤–æ–∑–±—É–∂–¥–µ–Ω–∏—è –Ω–µ–≥–∞—Ç–∏–≤–Ω—ã—Ö —ç–º–æ—Ü–∏–π —É –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª–µ–π —Ä–µ—Å—É—Ä—Å–∞.\r\n\r\n[1] ‚Äî –ö–∞–∫–æ–π Y –≤–∞–º –Ω—Ä–∞–≤–∏—Ç—Å—è –±–æ–ª—å—à–µ –≤—Å–µ–≥–æ.\r\n[2] ‚Äî –í—Å–µ, –∫—Ç–æ –ª—é–±–∏—Ç Y –≥–æ–≤–Ω–æ–µ–¥—ã, Y –Ω–µ –Ω—É–∂–Ω—ã.\r\n\r\n–í –¥–∞–Ω–Ω–æ–º —Å–ª—É—á–∞–µ –º–Ω–µ–Ω–∏–µ [2] –≤—ã—Ö–æ–¥–∏—Ç –∑–∞ —Ä–∞–º–∫–∏ –ø–æ—Å—Ç–∞–≤–ª–µ–Ω–Ω–æ–≥–æ –≤ [1] –≤–æ–ø—Ä–æ—Å–∞, –ø—Ä–æ–≤–æ—Ü–∏—Ä—É—è –¥–∏—Å–∫—É—Å—Å–∏—é –æ –ª–∏—á–Ω–æ—Å—Ç—è—Ö –∏ –º–µ—à–∞—è –æ–±—Å—É–∂–¥–∞—Ç—å –∏—Å—Ö–æ–¥–Ω—É—é —Ç–µ–º—É.\r\n\r\n[2] ‚Äî –Ø —Å—á–∏—Ç–∞—é, —á—Ç–æ Z.\r\n[3] ‚Äî >>2 —Ç–æ–ª—å–∫–æ –±—ã–¥–ª–æ —Å—á–∏—Ç–∞–µ—Ç, —á—Ç–æ Z.\r\n\r\n–í –¥–∞–Ω–Ω–æ–º —Å–ª—É—á–∞–µ [3] –ø—ã—Ç–∞–µ—Ç—Å—è –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –æ—Å–∫–æ—Ä–±–∏—Ç–µ–ª—å–Ω—ã–µ –Ω–∞ –±–æ—Ä–¥–∞—Ö —à–∞–±–ª–æ–Ω—ã –¥–ª—è —Ç–æ–≥–æ, —á—Ç–æ–±—ã –≤—ã–Ω—É–¥–∏—Ç—å [2] –æ—Ç–∫–∞–∑–∞—Ç—å—Å—è –æ—Ç –≤—ã—Ä–∞–∂–µ–Ω–∏—è —Å–≤–æ–µ–≥–æ –º–Ω–µ–Ω–∏—è –ø–æ —Ç–µ–º–µ –≤–º–µ—Å—Ç–æ —Ç–æ–≥–æ, —á—Ç–æ–±—ã –æ–ø—Ä–æ–≤–µ—Ä–≥–∞—Ç—å –≤—ã—Å–∫–∞–∑–∞–Ω–Ω–æ–µ –º–Ω–µ–Ω–∏–µ –ø–æ —Å—É—â–µ—Å—Ç–≤—É.','<div class=\"message\">\n–î–æ–±—Ä–æ—á–∞–Ω —è–≤–ª—è–µ—Ç—Å—è –º–µ—Å—Ç–æ–º, –≤ –∫–æ—Ç–æ—Ä–æ–º –º–æ–∂–Ω–æ –æ–±—Å—É–∂–¥–∞—Ç—å –ª—é–±—ã–µ —Ç–µ–º—ã –∏ –≤—ã—Å–∫–∞–∑—ã–≤–∞—Ç—å –ø–æ –Ω–∏–º –ª—é–±—ã–µ, —Å–∫–æ–ª—å —É–≥–æ–¥–Ω–æ —Ä–∞–¥–∏–∫–∞–ª—å–Ω—ã–µ –º–Ω–µ–Ω–∏—è, –ø–æ–∫–∞ –æ–Ω–∏ –æ—Å—Ç–∞—é—Ç—Å—è –≤ —Ä–∞–º–∫–∞—Ö –∑–∞–¥–∞–Ω–Ω–æ–π —Ç–µ–º—ã.<br/>\n<br/>\n–î–ª—è —Ä–µ–∞–ª–∏–∑–∞—Ü–∏–∏ —ç—Ç–æ–π –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç–∏ –≤ –ø–æ–ª–Ω–æ–π –º–µ—Ä–µ, –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –æ–±–µ—Å–ø–µ—á–∏—Ç—å —Å–æ–±–ª—é–¥–µ–Ω–∏–µ –¥–≤—É—Ö –∫–ª—é—á–µ–≤—ã—Ö –ø—Ä–∏–Ω—Ü–∏–ø–æ–≤ ‚Äî –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–∏–≤–Ω–æ–π –∞—Ç–º–æ—Å—Ñ–µ—Ä—ã –∏ –æ—Ç—Å—É—Å—Ç–≤–∏—è –¥–∏—Å–∫—Ä–∏–º–∏–Ω–∞—Ü–∏–∏ –ø—Ä–æ—Ç–∏–≤ –∞–≤—Ç–æ—Ä–æ–≤, –≤—ã—Å–∫–∞–∑—ã–≤–∞—é—â–∏—Ö –Ω–µ–ø–æ–ø—É–ª—è—Ä–Ω—ã–µ, —Ä–∞–¥–∏–∫–∞–ª—å–Ω—ã–µ –∏–ª–∏ –ø—Ä–æ—Ç–∏–≤–æ—Ä–µ—á–∞—â–∏–µ –Ω–æ—Ä–º–∞–º —Å–æ—Ü–∏—É–º–∞/–±–æ—Ä–¥–æ–≤–æ–π —Å—É–±–∫—É–ª—å—Ç—É—Ä—ã –º–Ω–µ–Ω–∏—è.<br/>\n<br/>\n–ù–∞ –ø—Ä–∞–∫—Ç–∏–∫–µ —ç—Ç–æ –≤—ã—Ä–∞–∂–∞–µ—Ç—Å—è –≤ –∑–∞–ø—Ä–µ—Ç–µ –æ–±—Å—É–∂–¥–µ–Ω–∏—è –ª–∏—á–Ω–æ—Å—Ç–∏ –∞–≤—Ç–æ—Ä–æ–≤ —Å–æ–æ–±—â–µ–Ω–∏–π, –µ—Å–ª–∏ –ª–∏—á–Ω–æ—Å—Ç—å –∞–≤—Ç–æ—Ä–∞ –Ω–µ —è–≤–ª—è–µ—Ç—Å—è –∏—Å—Ö–æ–¥–Ω–æ –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º–æ–π, –ø–æ–ø—ã—Ç–æ–∫ –≤—ã–Ω—É–¥–∏—Ç—å –∏—Ö –ø—Ä–µ–∫—Ä–∞—Ç–∏—Ç—å –ø—É–±–ª–∏—á–Ω–æ –≤—ã—Ä–∞–∂–∞—Ç—å —Å–≤–æ–µ –º–Ω–µ–Ω–∏–µ –∏ –ø–æ–ø—ã—Ç–æ–∫ –ø–æ–¥–º–µ–Ω–∏—Ç—å —Ç–µ–º—É –æ–±—Å—É–∂–¥–µ–Ω–∏—è.<br/>\n<br/>\n–ö–∞–∫ –ø—Ä–∞–≤–∏–ª–æ, –±–æ–ª—å—à–∏–Ω—Å—Ç–≤–æ —Ä–∞–∑–ª–∏—á–∏–π –º–µ–∂–¥—É –≤—ã—Ä–∞–∂–µ–Ω–∏–µ–º –º–Ω–µ–Ω–∏—è –∏ –æ–±—Å—É–∂–¥–µ–Ω–∏–µ–º/–¥–∞–≤–ª–µ–Ω–∏–µ–º –Ω–∞ –∞–≤—Ç–æ—Ä–∞ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É–µ—Ç –æ–¥–Ω–æ–º—É –∏–∑ —Å–ª–µ–¥—É—é—â–∏—Ö —Ç—Ä–µ—Ö —Å—Ü–µ–Ω–∞—Ä–∏–µ–≤:<br/>\n<br/>\n[1] ‚Äî –î–∞–≤–∞–π—Ç–µ –æ–±—Å—É–∂–¥–∞—Ç—å –•.<br/>\n[2] ‚Äî –ú–Ω–µ –∫–∞–∂–µ—Ç—Å—è, —á—Ç–æ –• –±—è–∫–∞.<br/>\n[3] ‚Äî <a>&gt;&gt;2</a> –ú–Ω–µ –∫–∞–∂–µ—Ç—Å—è, —á—Ç–æ –±—è–∫–∞ —ç—Ç–æ —Ç—ã.<br/>\n<br/>\n–í –¥–∞–Ω–Ω–æ–º —Å–ª—É—á–∞–µ [2] –≤—ã—Å–∫–∞–∑—ã–≤–∞–µ—Ç –º–Ω–µ–Ω–∏–µ, —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–µ –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º–µ, –∞ [3] –ø–µ—Ä–µ—Ö–æ–¥–∏—Ç –∫ –æ–±—Å—É–∂–¥–µ–Ω–∏—é –ª–∏—á–Ω–æ—Å—Ç–∏ –∞–≤—Ç–æ—Ä–∞ —Å–æ–æ–±—â–µ–Ω–∏—è, —Ç–µ–º —Å–∞–º—ã–º –Ω–∞—Ä—É—à–∞—è –ø—Ä–∞–≤–∏–ª–∞ –∏ –º–µ—à–∞—è –æ–±—Å—É–∂–¥–∞—Ç—å –•.<br/>\n<br/>\n–ü—Ä–∏ —ç—Ç–æ–º, –Ω–µ—Å–º–æ—Ç—Ä—è –Ω–∞ —Ç–æ, —á—Ç–æ [2] –º–æ–∂–µ—Ç –æ—Å–∫–æ—Ä–±–ª—è—Ç—å —á—É–≤—Å—Ç–≤–∞ –Ω–µ–∫–æ—Ç–æ—Ä—ã—Ö –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª–µ–π, —è–≤–ª—è—é—â–∏—Ö—Å—è –ø—Ä–∏–≤–µ—Ä–∂–µ–Ω—Ü–∞–º–∏ –• –∏–ª–∏ –∏–Ω—ã–º –æ–±—Ä–∞–∑–æ–º —Å–µ–±—è —Å –• –∞—Å—Å–æ—Ü–∏–∏—Ä—É—é—â–∏—Ö, —ç—Ç–æ –Ω–µ —è–≤–ª—è–µ—Ç—Å—è –Ω–∞—Ä—É—à–µ–Ω–∏–µ–º –ø—Ä–∞–≤–∏–ª –ø–æ–∫–∞ –º–Ω–µ–Ω–∏–µ –æ—Å—Ç–∞–µ—Ç—Å—è –≤ —Ä–∞–º–∫–∞—Ö –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º—ã –∏ –Ω–µ –Ω–∞–ø–∏—Å–∞–Ω–æ –∏—Å–∫–ª—é—á–∏—Ç–µ–ª—å–Ω–æ —Ä–∞–¥–∏ –≤–æ–∑–±—É–∂–¥–µ–Ω–∏—è –Ω–µ–≥–∞—Ç–∏–≤–Ω—ã—Ö —ç–º–æ—Ü–∏–π —É –ø–æ–ª—