—Ö –Ω–µ–¥–æ–ø—É—Å—Ç–∏–º–æ.\r\n\r\n–ö—Ä–∞–π–Ω–µ —Ä–µ–∫–æ–º–µ–Ω–¥—É–µ—Ç—Å—è —É—Å—Ç–∞–Ω–æ–≤–∏—Ç—å –ø–ª–∞–≥–∏–Ω –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –ø—Ä–∞–≤–æ–ø–∏—Å–∞–Ω–∏—è –¥–ª—è –≤–∞—à–µ–≥–æ –±—Ä–∞—É–∑–µ—Ä–∞.\r\nFirefox: https://addons.mozilla.org/en-us/firefox/addon/russian-spellchecking-dic-3703/\r\nChrome: https://support.google.com/chrome/answer/95604?hl=ru\r\n\r\n**–ù–∞ –î–æ–±—Ä–æ—á–∞–Ω–µ –Ω–µ –ø—Ä–∏–≤–µ—Ç—Å—Ç–≤—É–µ—Ç—Å—è –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ –≤ —Ç–µ–∫—Å—Ç–µ —Å–æ–æ–±—â–µ–Ω–∏–π —Å–º–∞–π–ª–∏–∫–æ–≤.**\r\n–ï—Å–ª–∏ –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –¥–æ–±–∞–≤–∏—Ç—å —Ç–µ–∫—Å—Ç—É —ç–º–æ—Ü–∏–æ–Ω–∞–ª—å–Ω—É—é –æ–∫—Ä–∞—Å–∫—É, —Ä–µ–∫–æ–º–µ–Ω–¥—É–µ—Ç—Å—è –¥–æ–±–∞–≤–∏—Ç—å –∫ —Å–æ–æ–±—â–µ–Ω–∏—é —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ.\r\n\r\n–ü—Ä–∏ –æ—Ç–≤–µ—Ç–µ –Ω–∞ –∫–∞–∫–æ–π-–ª–∏–±–æ –ø–æ—Å—Ç, –ø—Ä–∏–Ω—è—Ç–æ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —Å–ª–µ–¥—É—é—â–∏–π —Ñ–æ—Ä–º–∞—Ç:\r\n\r\n``\r\n>>–Ω–æ–º–µ—Ä_c–æ–æ–±—â–µ–Ω–∏—è_–Ω–∞_–∫–æ—Ç–æ—Ä–æ–µ_–æ—Ç–≤–µ—á–∞–µ—Ç–µ\r\n>–¶–∏—Ç–∞—Ç–∞, –Ω–∞ –∫–æ—Ç–æ—Ä—É—é –≤—ã –æ—Ç–≤–µ—á–∞–µ—Ç–µ\r\n–í–∞—à –æ—Ç–≤–µ—Ç\r\n``\r\n\r\n–í –æ–±—â–µ–º —Å–ª—É—á–∞–µ –Ω–∞ –î–æ–±—Ä–æ—á–∞–Ω–µ –¥–æ–ø—É—Å—Ç–∏–º–æ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ –Ω–µ–Ω–æ—Ä–º–∞—Ç–∏–≤–Ω–æ–π –ª–µ–∫—Å–∏–∫–∏, –æ–¥–Ω–∞–∫–æ –≤ –Ω–µ–∫–æ—Ç–æ—Ä—ã—Ö —Ç—Ä–µ–¥–∞—Ö –µ—Å—Ç—å –¥–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω—ã–µ –æ–≥—Ä–∞–Ω–∏—á–µ–Ω–∏—è.\r\n–ü—Ä–∏ —ç—Ç–æ–º –Ω–∞—Å—Ç–æ—è—Ç–µ–ª—å–Ω–æ –ù–ï —Ä–µ–∫–æ–º–µ–Ω–¥—É–µ—Ç—Å—è –∑–∞–º–µ–Ω—è—Ç—å –≤ —Å–ª–æ–≤–∞—Ö, –≤ —Ç–æ–º —á–∏—Å–ª–µ –Ω–µ–Ω–æ—Ä–º–∞—Ç–∏–≤–Ω—ã—Ö, –±—É–∫–≤—ã –Ω–∞ —Ü–∏—Ñ—Ä—ã –∏–ª–∏ —Å–ø–µ—Ü–∏–∞–ª—å–Ω—ã–µ —Å–∏–º–≤–æ–ª—ã, –≤–º–µ—Å—Ç–æ —ç—Ç–æ–≥–æ –¥–æ–ø—É—Å—Ç–∏–º–æ –ø—Ä—è—Ç–∞—Ç—å —Å–ª–æ–≤–∞ –∏ —Ñ—Ä–∞–∑—ã –ø–æ–¥ –≤–Ω—É—Ç—Ä–∏—Å—Ç—Ä–æ—á–Ω—ã–π —Å–ø–æ–π–ª–µ—Ä.','<div class=\"message\">\n–°–æ–æ–±—â–µ–Ω–∏—è –ø—É–±–ª–∏–∫—É—é—Ç—Å—è –¥–ª—è —Ç–æ–≥–æ, —á—Ç–æ–±—ã –∏—Ö —á–∏—Ç–∞–ª–∏ –¥—Ä—É–≥–∏–µ –ª—é–¥–∏, –∏ –æ–Ω–∏ <strong>–¥–æ–ª–∂–Ω—ã</strong> –±—ã—Ç—å –ø—Ä–µ–¥—Å—Ç–∞–≤–ª–µ–Ω—ã –≤ —Ñ–æ—Ä–º–∞—Ç–µ, —É–¥–æ–±–Ω–æ–º –¥–ª—è —á—Ç–µ–Ω–∏—è –∏ –ø–æ–Ω–∏–º–∞–Ω–∏—è –¥—Ä—É–≥–∏–º–∏ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è–º–∏ –î–æ–±—Ä–æ—á–∞–Ω–∞.<br/>\n<br/>\n–°–æ–æ–±—â–µ–Ω–∏—è (–ø–æ—Å—Ç—ã) –Ω–∞ –î–æ–±—Ä–æ—á–∞–Ω–µ –ø–∏—à—É—Ç—Å—è –Ω–∞ —Ä—É—Å—Å–∫–æ–º —è–∑—ã–∫–µ.<br/>\n–¢—Ä–∞–Ω—Å–ª–∏—Ç, –¥—Ä—É–≥–∏–µ —è–∑—ã–∫–∏, –≤ —Ç–æ–º —á–∏—Å–ª–µ –≤–∞—Ä–∏–∞—Ü–∏–∏ —Ä—É—Å—Å–∫–æ–≥–æ (–ø–∞–¥–æ–Ω–∫–æ—Å–≤—Å–∫–∏–π/–∞–ª–±–∞–Ω—Å–∫–∏–π –∏ —Ç.–¥.) –¥–æ–ø—É—Å—Ç–∏–º–æ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —Ç–æ–ª—å–∫–æ –ø—Ä–∏ –Ω–∞–ª–∏—á–∏–∏ –≤–µ—Å–∫–∏—Ö –ø—Ä–∏—á–∏–Ω, —Ç–∞–∫–∏—Ö –∫–∞–∫ –æ—Ç—Å—É—Ç—Å—Ç–≤–∏–µ –∫–∏—Ä–∏–ª–ª–∏—á–µ—Å–∫–æ–π —Ä–∞—Å–∫–ª–∞–¥–∫–∏ –∏–ª–∏ –≤ —Ç—Ä–µ–¥–µ, –ø–æ—Å–≤—è—â–µ–Ω–Ω–æ–º –∫–∞–∫–æ–º—É-–Ω–∏–±—É–¥—å –¥—Ä—É–≥–æ–º—É —è–∑—ã–∫—É.<br/>\n–ù–µ–¥–æ–ø—É—Å—Ç–∏–º–æ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –ª—é–±—ã–µ –≤–∏–¥—ã –∫–æ–¥–∏—Ä–æ–≤–æ–∫ –∏ —à–∏—Ñ—Ä–æ–≤–∞–Ω–∏–π, –∫—Ä–æ–º–µ –æ—Ç–∫—Ä—ã—Ç–æ–≥–æ —Ç–µ–∫—Å—Ç–∞ –≤ UTF-8.<br/>\n<br/>\n–ü—Ä–∏ –Ω–∞–ø–∏—Å–∞–Ω–∏–∏ —Å–æ–æ–±—â–µ–Ω–∏–π –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ —Ö–æ—Ç—è –±—ã –≤ –º–∏–Ω–∏–º–∞–ª—å–Ω–æ–π —Å—Ç–µ–ø–µ–Ω–∏ –ø—Ä–∏–ª–∞–≥–∞—Ç—å —É—Å–∏–ª–∏—è –∫ —Ç–æ–º—É, —á—Ç–æ–±—ã —Ç–µ–∫—Å—Ç –±—ã–ª –Ω–∞–ø–∏—Å–∞–Ω –≥—Ä–∞–º–æ—Ç–Ω–æ –∏ –≤ —Ä–∞–º–∫–∞—Ö –æ—Ñ–∏—Ü–∏–∞–ª—å–Ω–æ–π –æ—Ä—Ñ–æ–≥—Ä–∞—Ñ–∏–∏ —Ä—É—Å—Å–∫–æ–≥–æ —è–∑—ã–∫–∞.<br/>\n–í —á–∞—Å—Ç–Ω–æ—Å—Ç–∏, <br/>\n¬†¬† ‚Äî –ü—Ä–µ–¥–ª–æ–∂–µ–Ω–∏—è –Ω–∞—á–∏–Ω–∞—é—Ç—Å—è —Å –∑–∞–≥–ª–∞–≤–Ω–æ–π –±—É–∫–≤—ã, –∏ –∑–∞–∫–∞–Ω—á–∏–≤–∞—é—Ç—Å—è —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–∏–º –∑–Ω–∞–∫–æ–º –ø—Ä–µ–ø–∏–Ω–∞–Ω–∏—è ‚Äî —Ç–æ—á–∫–æ–π, –≤–æ–ø—Ä–æ—Å–∏—Ç–µ–ª—å–Ω—ã–º –∑–Ω–∞–∫–æ–º (–æ–¥–Ω–∏–º), –≤–æ—Å–∫–ª–∏—Ü–∞—Ç–µ–ª—å–Ω—ã–º –∑–Ω–∞–∫–æ–º (–æ–¥–Ω–∏–º) –∏–ª–∏ –º–Ω–æ–≥–æ—Ç–æ—á–∏–µ–º (–≤ –∏—Å–∫–ª—é—á–∏—Ç–µ–ª—å–Ω—ã—Ö —Å–ª—É—á–∞—è—Ö). <br/>\n¬†¬† ‚Äî –í —Ä—É—Å—Å–∫–æ–º —è–∑—ã–∫–µ <strong>–Ω–µ—Ç</strong> —Ç–∞–∫–∏—Ö —Å–ª–æ–≤, –∫–∞–∫ \"–ø–∞—Å–∏–±\", \"–ª–∞–Ω\" (–∞–ª–±. –ª–∞–¥–Ω–æ), \"–ø–æ–Ω—Ä–∞\" (–∞–ª–±. –ø–æ–Ω—Ä–∞–≤–∏–ª–æ—Å—å), \"–Ω–æ—Ä–º–∏–∫\" –∏ —Ç.–¥., –∏—Å–ø–æ–ª—å–∑—É–π—Ç–µ –∏—Ö —Ä—É—Å—Å–∫–∏–µ —ç–∫–≤–∏–≤–∞–ª–µ–Ω—Ç—ã.<br/>\n¬†¬† ‚Äî –ì—Ä—É–ø–ø–∞ –ø—Ä–µ–¥–ª–æ–∂–µ–Ω–∏–π, –≤—ã—Ä–∞–∂–∞—é—â–∞—è –∑–∞–∫–æ–Ω—á–µ–Ω–Ω—É—é –º—ã—Å–ª—å, –≤—ã–¥–µ–ª—è–µ—Ç—Å—è –≤ –∞–±–∑–∞—Ü –ø—Ä–∏ –ø–æ–º–æ—â–∏ —Å–∏–º–≤–æ–ª–∞ –ø–µ—Ä–µ–Ω–æ—Å–∞ —Å—Ç—Ä–æ–∫–∏.<br/>\n¬†¬† ‚Äî –ó–Ω–∞–∫–∏ \".\", \",\", \"!\", \"?\", \":\", \"...\", \";\", \")\" –æ—Ç–±–∏–≤–∞—é—Ç—Å—è –ø—Ä–æ–±–µ–ª–æ–º —Å –ø—Ä–∞–≤–æ–π —Å—Ç–æ—Ä–æ–Ω—ã. –¢–∏—Ä–µ –æ—Ç–±–∏–≤–∞–µ—Ç—Å—è –ø—Ä–æ–±–µ–ª–∞–º–∏ —Å –æ–±–æ–∏—Ö —Å—Ç–æ—Ä–æ–Ω. –û—Ç–∫—Ä—ã–≤–∞—é—â–∏–µ —Å–∫–æ–±–∫–∏ –∏ –∫–∞–≤—ã—á–∫–∏ - —Å –ª–µ–≤–æ–π —Å—Ç–æ—Ä–æ–Ω—ã. –î–µ—Ñ–∏—Å –∏ –∑–Ω–∞–∫ –¥–µ–ª–µ–Ω–∏—è –ø–∏—à—É—Ç—Å—è –±–µ–∑ –ø—Ä–æ–±–µ–ª–æ–≤.<br/>\n¬†¬† ‚Äî <a href=\"http://tsya.ru/\" rel=\"nofollow\">http://tsya.ru/</a><br/>\n¬†¬† ‚Äî –ú–Ω–æ–≥–æ—Ç–æ—á–∏—è –ø—Ä–∏–º–µ–Ω—è—é—Ç—Å—è –≤ –∏—Å–∫–ª—é—á–∏—Ç–µ–ª—å–Ω—ã—Ö —Å–ª—É—á–∞—è—Ö, –¥–ª—è —Å–æ–∑–¥–∞–Ω–∏—è —ç—Ñ—Ñ–µ–∫—Ç–∞ \"–æ–±–æ—Ä–≤–∞–Ω–Ω–æ–π\" –º—ã—Å–ª–∏. –ò—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å –º–Ω–æ–≥–æ—Ç–æ—á–∏—è –≤–º–µ—Å—Ç–æ —Ç–æ—á–µ–∫ –∏–ª–∏ –∑–∞–ø—è—Ç—ã—Ö –Ω–µ–¥–æ–ø—É—Å—Ç–∏–º–æ.<br/>\n<br/>\n–ö—Ä–∞–π–Ω–µ —Ä–µ–∫–æ–º–µ–Ω–¥—É–µ—Ç—Å—è —É—Å—Ç–∞–Ω–æ–≤–∏—Ç—å –ø–ª–∞–≥–∏–Ω –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –ø—Ä–∞–≤–æ–ø–∏—Å–∞–Ω–∏—è –¥–ª—è –≤–∞—à–µ–≥–æ –±—Ä–∞—É–∑–µ—Ä–∞.<br/>\nFirefox: <a href=\"https://addons.mozilla.org/en-us/firefox/addon/russian-spellchecking-dic-3703/\" rel=\"nofollow\">https://addons.mozilla.org/en-us/firefox/addon/russian-spellchecking-dic-3703/</a><br/>\nChrome: <a href=\"https://support.google.com/chrome/answer/95604?hl=ru\" rel=\"nofollow\">https://support.google.com/chrome/answer/95604?hl=ru</a><br/>\n<br/>\n<strong>–ù–∞ –î–æ–±—Ä–æ—á–∞–Ω–µ –Ω–µ –ø—Ä–∏–≤–µ—Ç—Å—Ç–≤—É–µ—Ç—Å—è –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ –≤ —Ç–µ–∫—Å—Ç–µ —Å–æ–æ–±—â–µ–Ω–∏–π —Å–º–∞–π–ª–∏–∫–æ–≤.</strong><br/>\n–ï—Å–ª–∏ –Ω–µ–æ–±—Ö–æ–¥–∏–º–æ –¥–æ–±–∞–≤–∏—Ç—å —Ç–µ–∫—Å—Ç—É —ç–º–æ—Ü–∏–æ–Ω–∞–ª—å–Ω—É—é –æ–∫—Ä–∞—Å–∫—É, —Ä–µ–∫–æ–º–µ–Ω–¥—É–µ—Ç—Å—è –¥–æ–±–∞–≤–∏—Ç—å –∫ —Å–æ–æ–±—â–µ–Ω–∏—é —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–µ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ.<br/>\n<br/>\n–ü—Ä–∏ –æ—Ç–≤–µ—Ç–µ –Ω–∞ –∫–∞–∫–æ–π-–ª–∏–±–æ –ø–æ—Å—Ç, –ø—Ä–∏–Ω—è—Ç–æ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —Å–ª–µ–¥—É—é—â–∏–π —Ñ–æ—Ä–º–∞—Ç:<br/>\n<code><pre>\n&gt;&gt;–Ω–æ–º–µ—Ä_c–æ–æ–±—â–µ–Ω–∏—è_–Ω–∞_–∫–æ—Ç–æ—Ä–æ–µ_–æ—Ç–≤–µ—á–∞–µ—Ç–µ\n&gt;–¶–∏—Ç–∞—Ç–∞, –Ω–∞ –∫–æ—Ç–æ—Ä—É—é –≤—ã –æ—Ç–≤–µ—á–∞–µ—Ç–µ\n–í–∞—à –æ—Ç–≤–µ—Ç</pre></code>\n\n–í –æ–±—â–µ–º —Å–ª—É—á–∞–µ –Ω–∞ –î–æ–±—Ä–æ—á–∞–Ω–µ –¥–æ–ø—É—Å—Ç–∏–º–æ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ –Ω–µ–Ω–æ—Ä–º–∞—Ç–∏–≤–Ω–æ–π –ª–µ–∫—Å–∏–∫–∏, –æ–¥–Ω–∞–∫–æ –≤ –Ω–µ–∫–æ—Ç–æ—Ä—ã—Ö —Ç—Ä–µ–¥–∞—Ö –µ—Å—Ç—å –¥–æ–ø–æ–ª–Ω–∏—Ç–µ–ª—å–Ω—ã–µ –æ–≥—Ä–∞–Ω–∏—á–µ–Ω–∏—è.<br/>\n–ü—Ä–∏ —ç—Ç–æ–º –Ω–∞—Å—Ç–æ—è—Ç–µ–ª—å–Ω–æ –ù–ï —Ä–µ–∫–æ–º–µ–Ω–¥—É–µ—Ç—Å—è –∑–∞–º–µ–Ω—è—Ç—å –≤ —Å–ª–æ–≤–∞—Ö, –≤ —Ç–æ–º —á–∏—Å–ª–µ –Ω–µ–Ω–æ—Ä–º–∞—Ç–∏–≤–Ω—ã—Ö, –±—É–∫–≤—ã –Ω–∞ —Ü–∏—Ñ—Ä—ã –∏–ª–∏ —Å–ø–µ—Ü–∏–∞–ª—å–Ω—ã–µ —Å–∏–º–≤–æ–ª—ã, –≤–º–µ—Å—Ç–æ —ç—Ç–æ–≥–æ –¥–æ–ø—É—Å—Ç–∏–º–æ –ø—Ä—è—Ç–∞—Ç—å —Å–ª–æ–≤–∞ –∏ —Ñ—Ä–∞–∑—ã –ø–æ–¥ –≤–Ω—É—Ç—Ä–∏—Å—Ç—Ä–æ—á–Ω—ã–π —Å–ø–æ–π–ª–µ—Ä.</div>','wakabamark',101),(17,'subject-freedom','ru','–°–≤–æ–±–æ–¥–∞ –æ–±—Å—É–∂–¥–∞–µ–º—ã—Ö —Ç–µ–º','–î–æ–±—Ä–æ—á–∞–Ω —Å—Ç—Ä–µ–º–∏—Ç—Å—è –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–∏—Ç—å –∫–∞–∂–¥–æ–º—É –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç—å –æ–±—Å—É–¥–∏—Ç—å –ª—é–±—É—é, –∏–Ω—Ç–µ—Ä–µ—Å—É—é—â—É—é –µ–≥–æ —Ç–µ–º—É.\r\n–î–ª—è —ç—Ç–æ–≥–æ –ª—é–±–æ–π –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –∏–º–µ–µ—Ç –ø—Ä–∞–≤–æ, –≤ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤–∏–∏ —Å –ø—É–Ω–∫—Ç–æ–º 2.1 —É—Å–ª–æ–≤–∏–π –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª–µ–Ω–∏—è —Å–µ—Ä–≤–∏—Å–∞, —Å–æ–∑–¥–∞—Ç—å —Ç—Ä–µ–¥ –ø–æ –∏–Ω—Ç–µ—Ä–µ—Å—É—é—â–µ–π –µ–≥–æ —Ç–µ–º–∞—Ç–∏–∫–µ, –≤ —Ä–∞–∑–¥–µ–ª–µ, –ø–æ–¥—Ö–æ–¥—è—â–µ–º –¥–ª—è –¥–∞–Ω–Ω–æ–π —Ç–µ–º–∞—Ç–∏–∫–µ –∏ –≤ —Ñ–æ—Ä–º–µ, –¥–æ–ø—É—Å—Ç–∏–º–æ–π –Ω–∞ –î–æ–±—Ä–æ—á–∞–Ω–µ.\r\n\r\n–ü—Ä–∏ —ç—Ç–æ–º –∫–∞–∂–¥—ã–π –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –∏–º–µ–µ—Ç –ø—Ä–∞–≤–æ –≤—ã—Å–∫–∞–∑—ã–≤–∞—Ç—å –≤ —Ç—Ä–µ–¥–µ –≤ —Ä–∞–º–∫–∞—Ö –∑–∞–¥–∞–Ω–Ω–æ–π —Ç—Ä–µ–¥–æ–º —Ç–µ–º—ã —Å–≤–æ–µ –º–Ω–µ–Ω–∏–µ, –≤ —Ç–æ–º —á–∏—Å–ª–µ —Ä–∞–¥–∏–∫–∞–ª—å–Ω–æ–µ –∏ –ø—Ä–æ—Ç–∏–≤–æ—Ä–µ—á–∞—â–µ–µ –æ–±—â–µ–ø—Ä–∏–Ω—è—Ç—ã–º –≤ —Å–æ—Ü–∏—É–º–µ –Ω–æ—Ä–º–∞–º, help://opinions.\r\n–û–¥–Ω–∞–∫–æ –ø—Ä–∞–≤–æ –Ω–∞ —Å–æ–∑–¥–∞–Ω–∏–µ —Ç—Ä–µ–¥–æ–≤ –∏ –æ–±—Å—É–∂–¥–µ–Ω–∏–µ –≤ –Ω–∏—Ö –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º—ã —è–≤–ª—è–µ—Ç—Å—è –±–æ–ª–µ–µ –ø—Ä–∏–æ—Ä–∏—Ç–µ—Ç–Ω—ã–º, –∏ –ª—é–±—ã–µ —Å–æ–æ–±—â–µ–Ω–∏—è, –∏–º–µ—é—â–∏–µ —Å–≤–æ–µ–π —Ü–µ–ª—å—é –≤—ã—Ä–∞–∑–∏—Ç—å –Ω–µ—É–¥–æ–≤–æ–ª—å—Å—Ç–≤–∏–µ —Ñ–∞–∫—Ç–æ–º –æ–±—Å—É–∂–¥–µ–Ω–∏—è —Ç–µ–º—ã –∏ –∏–Ω—ã–º –æ–±—Ä–∞–∑–æ–º –æ—Å—É–¥–∏—Ç—å –∞–≤—Ç–æ—Ä–∞ —Ç–µ–º—ã –∑–∞ —Å–æ–∑–¥–∞–Ω–∏–µ —Ç—Ä–µ–¥–∞, –∫–∞—Ç–µ–≥–æ—Ä–∏—á–µ—Å–∫–∏ –Ω–µ–¥–æ–ø—É—Å—Ç–∏–º—ã –∏ –Ω–∞—Ä—É—à–∞—é—Ç –ø—É–Ω–∫—Ç 2.2 ToS.\r\n\r\n–†–∞–≤–Ω—ã–º –æ–±—Ä–∞–∑–æ–º –Ω–µ–¥–æ–ø—É—Å—Ç–∏–º–æ —Ü–µ–ª–µ–Ω–∞–ø—Ä–∞–≤–ª–µ–Ω–Ω–æ –ø—É–±–ª–∏–∫–æ–≤–∞—Ç—å –≤ —Ç—Ä–µ–¥–µ —Å–æ–æ–±—â–µ–Ω–∏—è, –Ω–µ –æ—Ç–Ω–æ—Å—è—â–∏–µ—Å—è –∫ –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º–µ –∏ –º–µ–Ω—è—é—â–∏–µ –ø—Ä–µ–¥–º–µ—Ç –æ–±—Å—É–∂–¥–µ–Ω–∏—è. \r\n\r\n–î–æ–±—Ä–æ—á–∞–Ω –ø—Ä–µ–¥—É—Å–º–∞—Ç—Ä–∏–≤–∞–µ—Ç –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç—å –∏—Å–∫–ª—é—á–∏—Ç—å –ª—é–±–æ–π —Ç—Ä–µ–¥ –∏–∑ —Å–ø–∏—Å–∫–∞ –æ—Ç–æ–±—Ä–∞–∂–∞–µ–º—ã—Ö –≤ —Ä–∞–∑–¥–µ–ª–µ, –ø—É—Ç–µ–º –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏—è –∫–Ω–æ–ø–∫–∏ \"—Å–∫—Ä—ã—Ç—å —Ç—Ä–µ–¥\" —Å–ª–µ–≤–∞ –æ—Ç –ø–æ–ª—è —Ç–µ–º–∞ —Ç—Ä–µ–¥–∞ –≤ –ª–µ–≤–æ–º –≤–µ—Ä—Ö–Ω–µ–º —É–≥–ª—É. –ü–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è–º, –∫–æ—Ç–æ—Ä—ã–º –∫–∞—Ç–µ–≥–æ—Ä–∏—á–µ—Å–∫–∏ –Ω–µ –Ω—Ä–∞–≤–∏—Ç—Å—è –∫–∞–∫–∞—è-—Ç–æ —Ç–µ–º–∞, –Ω–∞—Å—Ç–æ—è—Ç–µ–ª—å–Ω–æ —Ä–µ–∫–æ–º–µ–Ω–¥—É–µ—Ç—Å—è –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —ç—Ç–æ—Ç —Ñ—É–Ω–∫—Ü–∏–æ–Ω–∞–ª. \r\n\r\n–ï—Å–ª–∏ –ø–æ –º–Ω–µ–Ω–∏—é –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è —Ç—Ä–µ–¥ –Ω–µ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É–µ—Ç —Ç–µ–º–∞—Ç–∏–∫–µ —Ä–∞–∑–¥–µ–ª–∞, –ª–∏–±–æ –æ—Ñ–æ—Ä–º–ª–µ–Ω —Å –Ω–∞—Ä—É—à–µ–Ω–∏–µ–º –ø—Ä–∞–≤–∏–ª, –ª–∏–±–æ —Å–æ–¥–µ—Ä–∂–∏—Ç –∫–æ–Ω—Ç–µ–Ω—Ç, –∑–∞–ø—Ä–µ—â–µ–Ω–Ω—ã–π –Ω–∞ –î–æ–±—Ä–æ—á–∞–Ω–µ, –∫–æ—Ä—Ä–µ–∫—Ç–Ω—ã–º —è–≤–ª—è–µ—Ç—Å—è —É–≤–µ–¥–æ–º–ª–µ–Ω–∏–µ –æ–± —ç—Ç–æ–º –º–æ–¥–µ—Ä–∞—Ü–∏–∏ –≤ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–º —Ç—Ä–µ–¥–µ —Ä–∞–∑–¥–µ–ª–∞ >>/d/. –û–±—Å—É–∂–¥–µ–Ω–∏–µ –≤–æ–ø—Ä–æ—Å–∞ –¥–æ–ø—É—Å—Ç–∏–º–æ—Å—Ç–∏ —Ç—Ä–µ–¥–∞ –≤ —Å–∞–º–æ–º —Ç—Ä–µ–¥–µ –Ω–µ–ø—Ä–∏–µ–º–ª–µ–º–æ.\r\n','<div class=\"message\">\n–î–æ–±—Ä–æ—á–∞–Ω —Å—Ç—Ä–µ–º–∏—Ç—Å—è –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–∏—Ç—å –∫–∞–∂–¥–æ–º—É –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç—å –æ–±—Å—É–¥–∏—Ç—å –ª—é–±—É—é, –∏–Ω—Ç–µ—Ä–µ—Å—É—é—â—É—é –µ–≥–æ —Ç–µ–º—É.<br/>\n–î–ª—è —ç—Ç–æ–≥–æ –ª—é–±–æ–π –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –∏–º–µ–µ—Ç –ø—Ä–∞–≤–æ, –≤ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤–∏–∏ —Å –ø—É–Ω–∫—Ç–æ–º 2.1 —É—Å–ª–æ–≤–∏–π –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª–µ–Ω–∏—è —Å–µ—Ä–≤–∏—Å–∞, —Å–æ–∑–¥–∞—Ç—å —Ç—Ä–µ–¥ –ø–æ –∏–Ω—Ç–µ—Ä–µ—Å—É—é—â–µ–π –µ–≥–æ —Ç–µ–º–∞—Ç–∏–∫–µ, –≤ —Ä–∞–∑–¥–µ–ª–µ, –ø–æ–¥—Ö–æ–¥—è—â–µ–º –¥–ª—è –¥–∞–Ω–Ω–æ–π —Ç–µ–º–∞—Ç–∏–∫–µ –∏ –≤ —Ñ–æ—Ä–º–µ, –¥–æ–ø—É—Å—Ç–∏–º–æ–π –Ω–∞ –î–æ–±—Ä–æ—á–∞–Ω–µ.<br/>\n<br/>\n–ü—Ä–∏ —ç—Ç–æ–º –∫–∞–∂–¥—ã–π –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å –∏–º–µ–µ—Ç –ø—Ä–∞–≤–æ –≤—ã—Å–∫–∞–∑—ã–≤–∞—Ç—å –≤ —Ç—Ä–µ–¥–µ –≤ —Ä–∞–º–∫–∞—Ö –∑–∞–¥–∞–Ω–Ω–æ–π —Ç—Ä–µ–¥–æ–º —Ç–µ–º—ã —Å–≤–æ–µ –º–Ω–µ–Ω–∏–µ, –≤ —Ç–æ–º —á–∏—Å–ª–µ —Ä–∞–¥–∏–∫–∞–ª—å–Ω–æ–µ –∏ –ø—Ä–æ—Ç–∏–≤–æ—Ä–µ—á–∞—â–µ–µ –æ–±—â–µ–ø—Ä–∏–Ω—è—Ç—ã–º –≤ —Å–æ—Ü–∏—É–º–µ –Ω–æ—Ä–º–∞–º, <a href=\"/help/opinions\" rel=\"nofollow\">help://opinions</a>.<br/>\n–û–¥–Ω–∞–∫–æ –ø—Ä–∞–≤–æ –Ω–∞ —Å–æ–∑–¥–∞–Ω–∏–µ —Ç—Ä–µ–¥–æ–≤ –∏ –æ–±—Å—É–∂–¥–µ–Ω–∏–µ –≤ –Ω–∏—Ö –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º—ã —è–≤–ª—è–µ—Ç—Å—è –±–æ–ª–µ–µ –ø—Ä–∏–æ—Ä–∏—Ç–µ—Ç–Ω—ã–º, –∏ –ª—é–±—ã–µ —Å–æ–æ–±—â–µ–Ω–∏—è, –∏–º–µ—é—â–∏–µ —Å–≤–æ–µ–π —Ü–µ–ª—å—é –≤—ã—Ä–∞–∑–∏—Ç—å –Ω–µ—É–¥–æ–≤–æ–ª—å—Å—Ç–≤–∏–µ —Ñ–∞–∫—Ç–æ–º –æ–±—Å—É–∂–¥–µ–Ω–∏—è —Ç–µ–º—ã –∏ –∏–Ω—ã–º –æ–±—Ä–∞–∑–æ–º –æ—Å—É–¥–∏—Ç—å –∞–≤—Ç–æ—Ä–∞ —Ç–µ–º—ã –∑–∞ —Å–æ–∑–¥–∞–Ω–∏–µ —Ç—Ä–µ–¥–∞, –∫–∞—Ç–µ–≥–æ—Ä–∏—á–µ—Å–∫–∏ –Ω–µ–¥–æ–ø—É—Å—Ç–∏–º—ã –∏ –Ω–∞—Ä—É—à–∞—é—Ç –ø—É–Ω–∫—Ç 2.2 ToS.<br/>\n<br/>\n–†–∞–≤–Ω—ã–º –æ–±—Ä–∞–∑–æ–º –Ω–µ–¥–æ–ø—É—Å—Ç–∏–º–æ —Ü–µ–ª–µ–Ω–∞–ø—Ä–∞–≤–ª–µ–Ω–Ω–æ –ø—É–±–ª–∏–∫–æ–≤–∞—Ç—å –≤ —Ç—Ä–µ–¥–µ —Å–æ–æ–±—â–µ–Ω–∏—è, –Ω–µ –æ—Ç–Ω–æ—Å—è—â–∏–µ—Å—è –∫ –∑–∞—è–≤–ª–µ–Ω–Ω–æ–π —Ç–µ–º–µ –∏ –º–µ–Ω—è—é—â–∏–µ –ø—Ä–µ–¥–º–µ—Ç –æ–±—Å—É–∂–¥–µ–Ω–∏—è. <br/>\n<br/>\n–î–æ–±—Ä–æ—á–∞–Ω –ø—Ä–µ–¥—É—Å–º–∞—Ç—Ä–∏–≤–∞–µ—Ç –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç—å –∏—Å–∫–ª—é—á–∏—Ç—å –ª—é–±–æ–π —Ç—Ä–µ–¥ –∏–∑ —Å–ø–∏—Å–∫–∞ –æ—Ç–æ–±—Ä–∞–∂–∞–µ–º—ã—Ö –≤ —Ä–∞–∑–¥–µ–ª–µ, –ø—É—Ç–µ–º –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏—è –∫–Ω–æ–ø–∫–∏ \"—Å–∫—Ä—ã—Ç—å —Ç—Ä–µ–¥\" —Å–ª–µ–≤–∞ –æ—Ç –ø–æ–ª—è —Ç–µ–º–∞ —Ç—Ä–µ–¥–∞ –≤ –ª–µ–≤–æ–º –≤–µ—Ä—Ö–Ω–µ–º —É–≥–ª—É. –ü–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è–º, –∫–æ—Ç–æ—Ä—ã–º –∫–∞—Ç–µ–≥–æ—Ä–∏—á–µ—Å–∫–∏ –Ω–µ –Ω—Ä–∞–≤–∏—Ç—Å—è –∫–∞–∫–∞—è-—Ç–æ —Ç–µ–º–∞, –Ω–∞—Å—Ç–æ—è—Ç–µ–ª—å–Ω–æ —Ä–µ–∫–æ–º–µ–Ω–¥—É–µ—Ç—Å—è –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —ç—Ç–æ—Ç —Ñ—É–Ω–∫—Ü–∏–æ–Ω–∞–ª. <br/>\n<br/>\n–ï—Å–ª–∏ –ø–æ –º–Ω–µ–Ω–∏—é –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è —Ç—Ä–µ–¥ –Ω–µ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É–µ—Ç —Ç–µ–º–∞—Ç–∏–∫–µ —Ä–∞–∑–¥–µ–ª–∞, –ª–∏–±–æ –æ—Ñ–æ—Ä–º–ª–µ–Ω —Å –Ω–∞—Ä—É—à–µ–Ω–∏–µ–º –ø—Ä–∞–≤–∏–ª, –ª–∏–±–æ —Å–æ–¥–µ—Ä–∂–∏—Ç –∫–æ–Ω—Ç–µ–Ω—Ç, –∑–∞–ø—Ä–µ—â–µ–Ω–Ω—ã–π –Ω–∞ –î–æ–±—Ä–æ—á–∞–Ω–µ, –∫–æ—Ä—Ä–µ–∫—Ç–Ω—ã–º —è–≤–ª—è–µ—Ç—Å—è —É–≤–µ–¥–æ–º–ª–µ–Ω–∏–µ –æ–± —ç—Ç–æ–º –º–æ–¥–µ—Ä–∞—Ü–∏–∏ –≤ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–µ–º —Ç—Ä–µ–¥–µ —Ä–∞–∑–¥–µ–ª–∞ <a href=\"/d/index.xhtml\">&gt;&gt;/d/</a>. –û–±—Å—É–∂–¥–µ–Ω–∏–µ –≤–æ–ø—Ä–æ—Å–∞ –¥–æ–ø—É—Å—Ç–∏–º–æ—Å—Ç–∏ —Ç—Ä–µ–¥–∞ –≤ —Å–∞–º–æ–º —Ç—Ä–µ–¥–µ –Ω–µ–ø—Ä–∏–µ–º–ª–µ–º–æ.<br/>\n</div>','wakabamark',102);
